import {CakeCard} from './Cake_card'

export function Cakelist(){
    
var cake1={
    name:"Pound Cake",
    description:"	Sponge cake, cream, food colouring",
    image:"cake3.jpg"
  }
  var cake2={
    name:"Baked Flourless Cake",
    description:"Egg whites, vanilla, and cream of tartar",
    image:"cake1.jpg"
  }
  var cake3={
    name:"Chiffon Cake",
    description:"Apple, caramel icing",
    image:"cake3.jpg"
  }
    return(
        <>
<div className="container">
<div className="d-flex">
 <Card data={cake1} /> 
 <Card data={cake2} />
 <Card data={cake3} />
</div>
</div>
        </>
    );
}
